DROP DATABASE IF EXISTS gbinder2005_Final_Project;
CREATE DATABASE gbinder2005_Final_Project;
USE gbinder2005_Final_Project;

CREATE TABLE `Employee` (
  `EMP_ID` int(11) NOT NULL,
  `EMP_FNAME` varchar(25) NOT NULL,
  `EMP_LNAME` varchar(25) NOT NULL,
  `EMP_EMAIL` varchar(50) NOT NULL,
  `EMP_PHONE` varchar(10) DEFAULT NULL,
  `EMP_POSITION` varchar(30) NOT NULL,
  `EMP_HIREDATE` date NOT NULL,
  `EMP_SALARY` decimal(8,2) NOT NULL,
  `EMP_TYPE` varchar(20) NOT NULL,
  PRIMARY KEY (`EMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Customer` (
  `CUS_ID` int(11) NOT NULL,
  `CUS_FNAME` varchar(25) NOT NULL,
  `CUS_LNAME` varchar(25) NOT NULL,
  `CUS_EMAIL` varchar(50) NOT NULL,
  `CUS_PHONENUM` varchar(10) DEFAULT NULL,
  `CUS_ADDRESS` varchar(30) NOT NULL,
  `CUS_CITY` varchar(20) NOT NULL,
  `CUS_STATE` varchar(20) NOT NULL,
  `CUS_ZIPCODE` int(11) NOT NULL,
  PRIMARY KEY (`CUS_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Supplier` (
  `SUP_ID` int(11) NOT NULL,
  `SUP_NAME` varchar(50) NOT NULL,
  `SUP_CONTACTNAME` varchar(50) NOT NULL,
  `SUP_EMAIL` varchar(50) NOT NULL,
  `SUP_PHONENUM` varchar(20) NOT NULL,
  `SUP_ADDRESS` varchar(50) DEFAULT NULL,
  `SUP_CITY` varchar(50) DEFAULT NULL,
  `SUP_COUNTRY` varchar(30) NOT NULL,
  PRIMARY KEY (`SUP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Invoice` (
  `INV_ID` int(11) NOT NULL,
  `INV_DATE` date DEFAULT NULL,
  `INV_AMOUNT` int(11) DEFAULT NULL,
  `INV_STATUS` varchar(20) DEFAULT NULL,
  `CUS_ID` int(11) NOT NULL,
  `EMP_ID` int(11) NOT NULL,
  PRIMARY KEY (`INV_ID`),
  KEY `CUS_ID` (`CUS_ID`),
  KEY `EMP_ID` (`EMP_ID`),
  FOREIGN KEY (`CUS_ID`) REFERENCES `Customer` (`CUS_ID`),
  FOREIGN KEY (`EMP_ID`) REFERENCES `Employee` (`EMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Delivery` (
  `EMP_ID` int(11) NOT NULL,
  `DEL_TITLE` varchar(30) NOT NULL,
  PRIMARY KEY (`EMP_ID`),
  FOREIGN KEY (`EMP_ID`) REFERENCES `Employee` (`EMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `IT` (
  `EMP_ID` int(11) NOT NULL,
  `IT_TITLE` varchar(30) NOT NULL,
  PRIMARY KEY (`EMP_ID`),
  FOREIGN KEY (`EMP_ID`) REFERENCES `Employee` (`EMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Support` (
  `EMP_ID` int(11) NOT NULL,
  `SUP_TITLE` varchar(30) NOT NULL,
  PRIMARY KEY (`EMP_ID`),
  FOREIGN KEY (`EMP_ID`) REFERENCES `Employee` (`EMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Inventory` (
  `PROD_ID` int(11) NOT NULL,
  `PROD_NAME` varchar(100) DEFAULT NULL,
  `PROD_TYPE` varchar(25) DEFAULT NULL,
  `UNITS_AVAILABLE` int(11) NOT NULL,
  `UNIT_PRICE` decimal(5,2) NOT NULL,
  `SUP_ID` int(11) NOT NULL,
  PRIMARY KEY (`PROD_ID`),
  KEY `SUP_ID` (`SUP_ID`),
  FOREIGN KEY (`SUP_ID`) REFERENCES `Supplier` (`SUP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Line` (
  `LINE_ID` int(11) NOT NULL,
  `PROD_ID` int(11) NOT NULL,
  `INV_ID` int(11) NOT NULL,
  `DELIVERY_DATE` date NOT NULL,
  PRIMARY KEY (`LINE_ID`),
  KEY `PROD_ID` (`PROD_ID`),
  KEY `INV_ID` (`INV_ID`),
  FOREIGN KEY (`PROD_ID`) REFERENCES `Inventory` (`PROD_ID`),
  FOREIGN KEY (`INV_ID`) REFERENCES `Invoice` (`INV_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Merchandise` (
  `PROD_ID` int(11) NOT NULL,
  `MERCH_TYPE` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`PROD_ID`),
  FOREIGN KEY (`PROD_ID`) REFERENCES `Inventory` (`PROD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Figures` (
  `PROD_ID` int(11) NOT NULL,
  PRIMARY KEY (`PROD_ID`),
  FOREIGN KEY (`PROD_ID`) REFERENCES `Inventory` (`PROD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `Media` (
  `PROD_ID` int(11) NOT NULL,
  `MEDIA_TYPE` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`PROD_ID`),
  FOREIGN KEY (`PROD_ID`) REFERENCES `Inventory` (`PROD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

