CREATE PROCEDURE INV_BY_EMAIL(
    IN email varchar(50)
)
begin
    SELECT Invoice.* FROM Invoice
    INNER JOIN Customer on Invoice.CUS_ID=Customer.CUS_ID
    WHERE Customer.CUS_EMAIL=email;
end;
